import React from "react";

export default function EditStudentModal({
  isOpen,
  form,
  errors,
  sigOptions,
  roleOptions,
  handleChange,
  updateStudent,
  closeModal,
}) {
  if (!isOpen) return null; // don’t render when closed

  return (
    <div className="fixed inset-0 flex items-center justify-center bg-black/60 backdrop-blur-sm z-50">
      <div className="bg-slate-900 border border-cyan-500/30 rounded-2xl p-8 shadow-2xl shadow-cyan-500/20 w-full max-w-2xl">
        <h3 className="text-2xl font-bold text-cyan-300 mb-6 text-center">
          EDIT STUDENT
        </h3>

        {errors.submit && (
          <div className="mb-6 p-4 bg-red-900/20 border border-red-500/50 rounded-lg">
            <p className="text-red-400 text-center">{errors.submit}</p>
          </div>
        )}

        {/* FORM FIELDS */}
        <div className="space-y-6">
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            {/* Name */}
            <div>
              <input
                name="name"
                placeholder="Name"
                value={form.name}
                onChange={handleChange}
                className={`w-full px-4 py-3 bg-slate-800/50 border ${
                  errors.name ? "border-red-500" : "border-cyan-500/30"
                } rounded-lg text-cyan-100 placeholder-cyan-400/60 focus:outline-none`}
              />
              {errors.name && (
                <p className="text-red-400 text-sm mt-1">{errors.name}</p>
              )}
            </div>

            {/* Roll No */}
            <div>
              <input
                name="rollno"
                placeholder="Roll No"
                value={form.rollno}
                onChange={handleChange}
                className={`w-full px-4 py-3 bg-slate-800/50 border ${
                  errors.rollno ? "border-red-500" : "border-cyan-500/30"
                } rounded-lg text-cyan-100 placeholder-cyan-400/60`}
              />
              {errors.rollno && (
                <p className="text-red-400 text-sm mt-1">{errors.rollno}</p>
              )}
            </div>

            {/* Email */}
            <div>
              <input
                name="email"
                placeholder="Email"
                value={form.email}
                onChange={handleChange}
                className={`w-full px-4 py-3 bg-slate-800/50 border ${
                  errors.email ? "border-red-500" : "border-cyan-500/30"
                } rounded-lg text-cyan-100 placeholder-cyan-400/60`}
              />
              {errors.email && (
                <p className="text-red-400 text-sm mt-1">{errors.email}</p>
              )}
            </div>

            {/* SIG */}
            <div>
              <select
                name="sig"
                value={form.sig}
                onChange={handleChange}
                className="w-full px-4 py-3 bg-slate-800/50 border border-cyan-500/30 rounded-lg text-cyan-100 focus:outline-none"
              >
                <option value="">Select SIG</option>
                {sigOptions.map((sig) => (
                  <option key={sig} value={sig}>
                    {sig}
                  </option>
                ))}
              </select>
              {errors.sig && (
                <p className="text-red-400 text-sm mt-1">{errors.sig}</p>
              )}
            </div>

            {/* Role */}
            <div>
              <select
                name="role"
                value={form.role}
                onChange={handleChange}
                className="w-full px-4 py-3 bg-slate-800/50 border border-cyan-500/30 rounded-lg text-cyan-100 focus:outline-none"
              >
                <option value="">Select Role</option>
                {roleOptions.map((role) => (
                  <option key={role} value={role}>
                    {role}
                  </option>
                ))}
              </select>
              {errors.role && (
                <p className="text-red-400 text-sm mt-1">{errors.role}</p>
              )}
            </div>
          </div>

          {/* BUTTONS */}
          <div className="flex justify-end gap-4 pt-6">
            <button
              onClick={closeModal}
              className="px-6 py-2 bg-gray-700 hover:bg-gray-600 text-white rounded-lg"
            >
              Cancel
            </button>
            <button
              onClick={updateStudent}
              className="px-6 py-2 bg-gradient-to-r from-cyan-600 to-pink-600 text-white font-bold rounded-lg hover:scale-105 transition-transform"
            >
              Update
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}
